import React , { Fragment, useState, useEffect } from 'react';

interface ITodo {
    text: string
    complete: boolean
  }

export default function TodoList(todos): JSX.Element{

    return (
        <section>
        {todos.map((todo: ITodo, index: number) => (
          <Fragment key={index}>
            <div>
              {todo.text} {' '}

                {
                  todos[index].complete ? 

                  <button type='button' onClick={() => complete(index)}>TODO</button>

                  : 

                  <button type='button' onClick={() => complete(index)}>Complete</button>
                }
            </div>     
          </Fragment>
        ))}
      </section>
    )

}
